import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";
import Projects from "./Projects";
import Blog from "./Blog";
import SocialMedia from "./SocialMedia";
import Services from "./Services";
import About from "./About";

function App() {
  return (
    <Router>
      <div className="App">
        <header className="header1">
          <h1>Starlight Technology</h1>
          <nav>
            <ul className="nav-links">
              <li><Link to="/projects">Projects</Link></li>
              <li><Link to="/blog">Blog</Link></li>
              <li><Link to="/social-media">Social Media</Link></li>
              <li><Link to="/services">Services</Link></li>
              <li><Link to="/about">About</Link></li>
            </ul>
          </nav>
        </header>
        
        <div className="MainContent">
          <Routes>
            <Route path="/" element={
              <>
                <section className="mission-statement">
                  <h2>Mission Statement</h2>
                  <p>
                    At Starlight Technology, our mission is to empower businesses with innovative tech solutions that drive growth and success. We are committed to delivering excellence and staying ahead of the curve in a constantly evolving digital landscape.
                  </p>
                </section>
              </>
            } />
            <Route path="/projects" element={<Projects />} />
            <Route path="/blog" element={<Blog />} />
            <Route path="/social-media" element={<SocialMedia />} />
            <Route path="/services" element={<Services />} />
            <Route path="/about" element={<About />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
